import TagItem from "../TagItem/TagItem";

const Tags = ({ title, tags }) => {
    return ( 
        <div className="tags">
            <h2>{title}</h2>
            <div className="tag-items">
                {tags.map(tag => <TagItem />)}
            </div>
        </div>
    );
}

export default Tags;
